import React from 'react'
import * as rb from 'react-bootstrap'

class TopNavBar extends React.Component{

    render(){

        return (

            <Navbar bg="white">
                <Navbar.Brand style={{fontSize:30}}>
                    Filter:
                </Navbar.Brand>
                <Button></Button>
            </Navbar>

        )

    }

}

export default TopNavBar
